import ExpenseItem from "./ExpenseItem";
import ExpenseFilter from "./ExpenseFilter";
function Expenses(props) {
  const sp = props.expenses.map((value, index) => {
    return (
      <ExpenseItem
        title={value.title}
        amount={value.amount}
        date={value.date}
        key={index}
      ></ExpenseItem>
    );
  });
  return (
    <div>
      <ExpenseFilter />
      {sp}
    </div>
  );
}
export default Expenses;
